import './App.css';
import { Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <div className="boxs">
      <h1>Home</h1>
      <Link to="/login">Login</Link>
      <Link to="/register">Register</Link>
      </div>
    </div>
  );
}

export default App;
